var citiesByState = {
    Delhi: ["Delhi IVF and Fertility Research Centre","Delhi Institute of Trauma & Orthopedics (DITO)","Moolchand Medcity","Fortis Flt. Lt. Rajan Dhall Hospital, Vasant Kunj","SCI International Hospital - Best Hospital in Delhi"],
    Mumbai : ["Jaslok Hospital and Research Centre","Global Hospitals, Mumbai","Fortis Hospital Mulund","Wockhardt Hospitals, Mumbai Central","Kohinoor Hospital"],
    Kolkata : ["Ruby General Hospital","Calcutta Heart Clinic & Hospital","AMRI Hospital - Dhakuria","AMRI HOSPITAL, SALT LAKE","Kolkata Medical Complex Hospital"],
    Chennai : ["Dr. Mehta's Hospitals","Apollo Hospital Chennai","Sri Senthil Nursing Home","Venkataeswara Hospitals","CAPSTONE CLINIC - Multispeciality, Vaccine and Dental Clinic"]
}
function makeSubmenu(value) {
    if(value.length==0) document.getElementById("hospital").innerHTML = "<option></option>";
    else {
        var citiesOptions = "";
        for(cityId in citiesByState[value]) {
        citiesOptions+="<option>"+citiesByState[value][cityId]+"</option>";
        }
        document.getElementById("hospital").innerHTML = citiesOptions;
    }
}
function resetSelection() {
document.getElementById("city").selectedIndex = 0;
document.getElementById("hospital").selectedIndex = 0;
}
